import React, { useEffect, useState } from 'react';
import uuid from 'react-uuid';


function App(){

    const [backendData, setBackendData] = useState([{}]);

    useEffect(()=>{
        fetch("/api").then(
            response => response.json()
        ).then(
            data => {
                setBackendData(data);
            }
            
        )
        console.log(backendData.keys)
    }, [])

    return (
        <div>

            {(backendData.length === 0) ? (
                <p>Loading</p>
            ): (
                // backendData.map((fileName)=>(
                //     <div>
                //         <h2 key={uuid}></h2>
                //     </div>
                    
                // ))

                <h1>Hi</h1>
            )}

        </div>
    )
}

export default App;
